function MenuCategories(props) {
     const categories = props.categoryArry;
     return (
          <div className='menu_categories'>
               {categories.map((item, i) => {
                    let categoryColor = {
                         display: 'flex',
                         justifyContent: 'center',
                         alignItems: 'center',
                         backgroundColor: item.color,
                         width: '125px',
                         height: '55px',
                         margin: '3px',
                         borderRadius: '3px',
                         color: 'white',
                         fontSize: '1em',
                    };
                    return (
                         <div
                              onClick={() => props.setCurrent(item.category)}
                              className={(categoryColor, 'menu_categoryBtn')}
                              key={i}
                         >
                              {item.category}
                         </div>
                    );
               })}
          </div>
     );
}

export default MenuCategories;
